import React from "react";
import CountButton from "./CountButton";

const App = () => {
  return (
    <div>
      <CountButton incrementBy={1} buttonColor={"blue"} />
      <CountButton incrementBy={5} buttonColor={"red"} />
      <CountButton incrementBy={10} buttonColor={"red"} />
    </div>
  );
};

export default App;
